import React, { Component } from 'react';
import model from "./Model";
import './App.css';
import LoginPage from "./Pages/LoginPage/LoginPage";
import ProfilePage from "./Pages/ProfilePage/ProfilePage";
import MovieDetailsPage from "./Pages/MovieDetailsPage/MovieDetailsPage";
import SearchPage from "./Pages/SearchPage/SearchPage";
import {BrowserRouter, Route, Switch} from "react-router-dom";
import LandingPage from "./Pages/LandingPage/LandingPage";

class App extends Component {
  render() {
    return (
      <div className="App">
          <BrowserRouter>
              <div>
                  <Switch>
                      <Route exact path='/' component={LoginPage}/>
                      <Route path='/profile/:id' render={({ location, match }) => <ProfilePage model={model} params={match.params}/>}/>
                      <Route path='/moviedetails/:id' render={({ location, match }) => <MovieDetailsPage model={model} params={match.params}/>}/>
                      <Route path='/search/:value' render={({ location, match }) => <SearchPage model={model} params={match.params}/>}/>
                      <Route path='/landing' render={() => <LandingPage model={model}/>}/>

                  </Switch>
              </div>
          </BrowserRouter>
      </div>
    );
  }
}

export default App;
